import React, { Component } from 'react';

class Home extends Component {
    render() {
        return(
            <div className='h-100'>
                <section>
                <TextField
                id="outlined-name"
                label="Name"
                margin="normal"
                variant="outlined"
                />
                </section>
            </div>
        );  
    }
}

export default Home;
